import React from 'react';
import './Guideslist.css';

const images = [
  { src: require('../images/apexlegends.png'), title: 'Apex Legends' },
  { src: require('../images/callofdutywarzone2.png'), title: 'Call of Duty Warzone 2.0' },
  { src: require('../images/counterstrike2.png'), title: 'Counter Strike 2' },
  { src: require('../images/fortnite.png'), title: 'Fortnite' },
  { src: require('../images/leagueoflegends.png'), title: 'League of Legends' },
  { src: require('../images/overwatch2.png'), title: 'Guide 6' },
  { src: require('../images/rainbowsixsiege.png'), title: 'Guide 7' },
  { src: require('../images/rocketleague.png'), title: 'Guide 8' },
  { src: require('../images/valorant.png'), title: 'Guide 9' },
];

const Guideslist = () => {
  return (
    <div className="guides-list">
      {images.map((image, index) => (
        <div key={index} className="guide-item">
          <img src={image.src} alt={image.title} />
          <p>{image.title}</p>
        </div>
      ))}
    </div>
  );
};

export default Guideslist;
